import React from 'react';
import Navigation from '../components/navigation';
import "../styles/settings.css";

function Galerie() {
    return (
      <div className="App">
        <Navigation/>
        <header className="Page">
           <h1>This is the galerie page</h1>
           <iframe width="356" height="200" src="https://jbtv-galerie.ece.fr/embed/2021-2022/Voyages-des-Caves/i-xBNwq2W" title="photo"></iframe>
        </header>
      </div>
    );
}
  
export default Galerie;
